INSERT INTO `player` VALUES (1,1998,'1976-03-24','Peyton Manning','Manning signed a 5 year, $96 million contract with the Broncos on March 20, 2012. Upon signing Manning had $18 million of the contract fully guaranteed. His 2013 and 2014 base salaries became fully guaranteed following his passing of a 2013 physical exam.\\u003Cbr \\/\\u003E\\r\\n\\u003Cbr \\/\\u003E\\r\\nIn 2013 the Broncos advanced Manning $10 million in salary which is prorated over the course of the contract. The Broncos have an injury waiver on future guarantees if Manning re-injures his neck. ','Tennessee',1,1,1998,'6-5',10,230),(2,2011,'1989-03-26','Von Miller','Miller, the second overall pick in the 2011 NFL Draft, signed a fully guaranteed contract worth $21,000,376 with the Denver Broncos. Miller\'s signing bonus is worth $13,773,000. \\u003Cbr\\/\\u003E\\u003Cbr\\/\\u003EMiller was suspended for six games in 2013. ','Texas A&M',2,1,2011,'6-3',13,250),(3,2008,'1986-09-06','Ryan Clady','Clady signed a five year contract worth $52,500,000 with the Broncos on July 15, 2013. Clady received a $3 million signing bonus and $10.5 million roster bonus in 2013 to go along with a fully guaranteed $1.5 million base salary, making the full guarantee worth a total of $15 million.\\u003Cbr \\/\\u003E\\r\\n\\u003Cbr \\/\\u003E\\r\\nClady\'s 2014 and 2015 base salaries are guaranteed for injury only and become fully guaranteed on the 5th day of the League Year. Clady will receive a $1.5 million roster bonus on the 5th day of the 2015 League Year which is guaranteed for injury only. Clady\'s contract contains escalators if names to the All Pro team. ','Boise State',12,1,2008,'6-6',13,315),(4,1999,'1978-06-22','Champ Bailey','CB Champ Bailey signed a two year, $3.75 million contract with the New Orleans Saints on April 9, 2014. Bailey received a $500,000 signing bonus. If Bailey is on the active gameday roster for six games in 2014 he will earn an additional $250,000 roster bonus. In 2015 Bailey will earn a $250,000 roster bonus on the 5\\u003Csup\\u003Eth\\u003C\\/sup\\u003E day of the League Year and another $250,000 if on the roster on week 1. Base salaries of the contract are $1,000,000(2014) and $1,500,000(2015).\\u003Cbr \\/\\u003E\\r\\n\\u003Cbr \\/\\u003E\\r\\nBailey was released by the Broncos on March 5, 2014. He had one year remaining on his contract. His release saved Denver $10 million in cap room. ','Georgia',7,1,1999,'6-0',20,192),(5,2012,'1990-07-05','Aaron Brewer',' ','San Diego State',0,0,2012,'6-5',13,230),(6,2008,'1985-04-15','Andre Caldwell',' ','Florida',97,3,2008,'6-0',7,200),(7,1999,'1976-06-23','Brandon Stokley',' ','Louisiana-Lafayette',105,4,1999,'6-0',5,194),(8,2012,'1990-11-22','Brock Osweiler','Osweiler, a 2nd round pick in the 2012 draft, signed a four year contract with the Broncos worth $3,516,678. Osweiler\'s contract contains a 2014 roster bonus worth $139,698 and 2015 roster bonus worth $209,547. His 2012 and 2013 base salaries are fully guaranteed ','Arizona State',57,2,2012,'6-8',13,240),(9,2011,'1989-06-18','Chris Harris','CB Chris Harris signed a $42.5 million contract extension with the Denver Broncos on December 12, 2014. Harris received a $10 million signing bonus. We will update the rest of his salaries once we have more details on the contract. ','Kansas',0,0,2011,'5-10',13,199),(10,2006,'1982-12-19','Chris Kuper',' ','North Dakota',161,5,2006,'6-4',13,303),(11,2011,'1900-01-01','CJ Davis',' ','0',0,0,0,'0',0,0),(12,2004,'1979-09-12','Dan Koppen',' ','Boston College',164,5,2003,'6-3',2,296),(13,2012,'1990-03-24','Danny Trevathan',' ','Kentucky',188,6,2012,'6-1',13,240),(14,2010,'1987-03-15','Eric Decker','WR Eric Decker signed a five year, $36.25 million contract with the New York Jets on March 13, 2014. Decker received $15 million fully guaranteed. The guarantee is made up of Decker\'s 2014 and 2015 base salaries and a $7.5 million signing bonus. Base salaries of the contract are $2,500,000(2014), $5,000,000(2015), $6,500,00