signing bonus. $819,000 of Miller\'s 2015 salary is currently guaranteed for injury only and will become fully guaranteed if on the roster on April 1, 2015. Each extension years carries up to $160,000 in per game active roster bonuses and $200,000 incentives for being selected to the Pro Bowl. Base salaries are $635,000(2014), $1,100,000(2015), $1,250,000(2016), and $1,450,000(2017). ','Central Florida',211,7,2011,'6-2',31,248),(58,2009,'1986-05-06','C.J. Spillman',' ','Marshall',0,0,2009,'6-0',15,199),(59,2013,'1990-05-24','Cam Johnson',' ','Virginia',237,7,2012,'6-3',31,268),(60,2005,'1981-07-02','Carlos Rogers','CB Carlos Rogers signed a one year $2.5 million contract with the Oakland Raiders on April 1, 2014. Rogers received a $1 million signing bonus. He can earn up to $250,000 in per game active roster bonuses. The total value of the contract can reach $3.5 million based on meeting playtime incentives. ','Auburn',9,1,2005,'6-0',20,192),(61,2011,'1988-08-17','Chris Culliver',' ','South Carolina',80,3,2011,'6-0',31,199),(62,2011,'1987-11-03','Colin Kaepernick','Colin Kaepernick signed a six year, $114 million extension with the San Francisco 49ers on June 4, 2014. Kaepernick received $12,973,766 in full guarantees made up of a $645,000 base salary and $12,328,766 signing bonus. From 2015 through 2017 his entire base salary is guaranteed for injury only as is $5.2 million of his 2018 base salary. If Kaepernick is on the 49ers roster on April 1 of the respective League Year the guarantee vests to full. Kaepernick can earn $2 million per year\\u00a0in\\u00a0per game roster bonuses. $12 million in escalators are available. In order to earn the full escalator amount Kaepernick must participate in 80% of the offensive snaps in 2014 and either be named first or second team All Pro or be on the active roster of a Super Bowl team. For each year that this is not accomplished the\\u00a0escalator value\\u00a0reduces by $2 million.\\u003Cbr \\/\\u003E\\r\\n\\u003Cbr \\/\\u003E\\r\\nKaepernick was drafted in the 2nd round of the 2011 NFL Draft. He signed a 4 year contract worth $5,124,296 which included a $2,226,764 signing bonus. His base salaries in 2011 and 2012 were fully guaranteed and $590,314 of his 2013 base salary was fully guaranteed. Kaepernick can earn workout bonuses of $100,000 in the final two years of his contract. ','Nevada',36,2,2011,'6-4',31,230),(63,2011,'1987-12-18','Daniel Kilgore','Daniel Kilgore signed a three year, $5.25 million extension with the 49ers on February 27, 2014. Kilgore received a $1.35 million signing bonus and a fully guaranteed base salary in 2014. In every year he can earn up to $200,000 in per game active roster bonuses and he also has a $600,000 roster bonus due in April of 2015. Kilgore can earn escalators of $900,000 in 2016 and 2017. Base salaries of the contract are $645,000(2014), $800,000(2015), $900,000(2016), and $1,000,000(2017) ','Appalachian State',163,5,2011,'6-3',31,308),(64,2012,'1989-07-19','Darius Fleming',' ','Notre Dame',165,5,2012,'6-2',31,255),(65,2009,'1987-04-07','Jared Cook',' ','South Carolina',89,3,2009,'6-5',12,254),(66,2010,'1987-11-03','Cassius Vaughn','CB Cassius Vaughn signed a one year $730,000 contract with the Detroit Lions on April 7, 2014. Vaughn qualifies for the minimum salary benefit. ','Mississippi',0,0,2010,'5-11',13,195),(67,2009,'1986-11-08','Sammie Lee Hill',' ','Stillman',115,4,2009,'6-4',22,328),(68,2011,'1987-11-30','Demarcus Dobbs',' ','Georgia',0,0,2011,'6-6',31,282),(69,2006,'1985-07-24','Donte Whitner','Donte Whitner signed a four year, $28 million contract with the Cleveland Browns on March 11, 2014. Whitner received a $9 million signing bonus and a fully guaranteed 2014 base salary. He will earn another $2 million in guarantees if on the roster 5 days following the 2014 Super Bowel. Base salaries of the contract are $2,000,000(2014), $4,500,000(2015), $6,200,000(2016), and $6,300,000(2017). ','Ohio State',8,1,2006,'5-10',1,208),(70,2012,'1988